const getDog = async (breedId) => {

    

    const url = "http://localhost:8000/showAPI";
    const res = await fetch(url);
    const data = await res.json();
    
    const dog = {
			image: data[breedId].image_url,
			breed: {
				id: data[breedId].id,
				name: data[breedId].name,
			},
		};
    return dog
}

export default getDog;
